import React from 'react';
import PropTypes from 'prop-types'

const CounterApp = ( { number } ) => {
    return (
        <>
            <h1> Counter App </h1>
            <h2> { number } </h2>
        </>
    );
}

CounterApp.propTypes = {
    number: PropTypes.number.isRequired
}

export default CounterApp;
